import React from 'react';
import ButtonBase from '@mui/material/ButtonBase';
import './Tile.css';
import birdhouse from './images/birdhouse.png';

const Tile = () => {
    return(
        <ButtonBase className="Tile">
            <div>
                <img src={birdhouse} alt="Birdhouse button" />
                <h3>Bird house</h3>
            </div>
        </ButtonBase>
    );
}

export default Tile;
